import createLucideIcon from '../createLucideIcon';

const StepForward = createLucideIcon('StepForwardIcon', [
  ['line', { x1: '6', x2: '6', y1: '4', y2: '20', key: 'fy8qot' }],
  ['polygon', { points: '10,4 20,12 10,20', key: '1mc1pf' }],
]);

export default StepForward;
